import './App.css';
import React from 'react';
import { useSpring, animated, useScroll, useInView} from '@react-spring/web';
import { useEffect, useState } from 'react';

function InterPageTransition() {
    const { scrollYProgress } = useScroll();
    useEffect(() => {
        console.log('Scroll Y Progress:', scrollYProgress.get());
      }, [scrollYProgress]);
    return(
        <animated.div style={{ color: 'white',  }}>
            Hello World
        </animated.div>
    );
};

export default InterPageTransition;
